description:
Rekhila Promotion vous propose un F4 spacieux dans sa résidence au design moderne Besma II. 
La résidence est situé à l'entrée de Boufarik avec un accès direct par autoroute et une proximité de la ville de Boufarik. Elle offre également de nombreuses commodités comme :

- Un service de gardiennage ;
- Des caméras de surveillance ;
- Un air de jeux ;
- Une salle de sport ;
- Des box de parking ;
- Ascenseurs. 

Cet f4 est doté de 3 chambres spacieuses, d'un séjour/ cuisine open space et d'un grand balcon. L'appartement est aussi équipé d'une climatisation, d'un chauffage centrale, ainsi que d'une cuisine et une salle de bain aménagées avec des matériaux de qualité au design moderne.

Loue dans résidence clôturée et gardée, chez Hasnaoui (2eme tranche), bel appartement F4 haut standing, 3 façades, sans vis-à-vis, 6e  et dernier étage, avec toutes commodités dont notamment :
Climatisation;
Cellier en sous-sol ;
Salon avec terrasse ;
Chauffage central ;
Placard dans chaque chambre ;
Place au parking sous-terrain (en option)…

Résidence Des Gardénias   
La résidence Des Gardénias est une promotion immobilière comprenant 122 appartements se situe au cœur d’un quartier très calme dans la commune de Chéraga, à l’ouest d’Alger, qui se longent la route Nationale, sur un axe routier de diverse direction (staoueli, ouled fayet, ain benian, dely brahim, bouchaoui), aussi, proche entrée/sortie autoroute sur 4 km vers alger et tipaza.
La résidence des Gardénias est un programme immobilier à l’architecture moderne, érigé en R+13 et composée d’appartement F2, F3, F4, F5 et duplex ainsi qu’un bloc administratif en R+7.  
appartements type F4 :108M2 -143M2-131M2 -
Son architecture contemporaine le dote d’une identité forte, transparence, lumière et végétalisation sont privilégiées.
Le projet est couvert par une assurance auprès du fond de garantie et de Cautionne mutuelle de la promotion immobilière 

Délais de réalisation : 36 mois   (OCTOBRE 2023 )   

Caractéristiques : 
Nous proposons dans cette résidence des appartements luxueux, dotés de cuisines et salles de bain équipées. 
Les commodités à savoir : 
-	Résidence clôturée avec gardiennage ; 
-	Parking ;
-	Ascenseur ; 
-	Climatiseurs ; 
-	Chauffage central ;
-	Récepteur satellite.
